        <div className="flex w-full">
            <div className="grid flex-grow h-40 card rounded-box place-items-center">

                <p className="mt-5"><span id="coinumber">1 </span> Bitcoin (BTC)
                </p>

                <div className="ethereum">
                    <p className=""><span id="coinumber1">1 </span> Ethereum (ETH)
                    </p>
                </div>
                <div className=""><span>=</span></div>

                <p><span className="font-bold hidden">21,626.17</span><span>
                  States Dollar"$"
                  (USD)</span></p>
            </div>
            <div className=""></div>


        </div>
    );

};

export default CryptCard;
